import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Header.css"; // Import CSS for styling

const Header = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <header className="header">
      <h1>My Tent House</h1>
      <nav>
        <ul className={menuOpen ? "nav-links show" : "nav-links"}>
          <li>
            <Link to="/" onClick={toggleMenu}>
              Home
            </Link>
          </li>
          <li>
            <Link to="/booking" onClick={toggleMenu}>
              Booking
            </Link>
          </li>
          <li>
            <Link to="/gallery" onClick={toggleMenu}>
              Gallery
            </Link>
          </li>
          <li>
            <Link to="/contact" onClick={toggleMenu}>
              Contact
            </Link>
          </li>
        </ul>
      </nav>
      <div className="menu-icon" onClick={toggleMenu}>
        <div className={menuOpen ? "line line1" : "line"}></div>
        <div className={menuOpen ? "line line2" : "line"}></div>
        <div className={menuOpen ? "line line3" : "line"}></div>
      </div>
    </header>
  );
};

export default Header;
